<?php

class ReplyTableSeeder extends Seeder {

	/**
	 * Run the database seeds.
	 *
	 * @return void
	 */
	public function run()
	{
		
		#To create a new record in the database from a model, simply create a new model instance and call the save method.
		# Instantiate new instance of said model
		$reply = new Reply();
		
		# fk of the sotry @ stories table
		$reply->story_id = '1';
		
		# The the text string that tells the story
		$reply->text = 'Response ullam quam consequat magna sapien curabitur dictum dictumst velit, nam suspendisse tempor consectetur nibh suspendisse nulla donec ma';
	
		# fk of user id
		$reply->user_id= '1';
		
		# An image as base64
		#decode will be jpeg
		$image = base64_decode('
');
		
		# path to root and img folder
		$destinationPath = public_path() . "/img/";
		
		$fileName = bin2hex(mcrypt_create_iv(8, MCRYPT_DEV_URANDOM));
						
		file_put_contents($destinationPath . $fileName .'.png', $image);
		
		#store location in db
		$reply->file_name = $fileName .'.png';

		
		
		# Eloquent Magic
		$reply->save();
		
		# Let us know what happned.
		$this->command->info('Seeded Story Table'); 
